// Buttons.js
import React from 'react';
import { Link } from 'react-router-dom';
import classes from './Buttons.module.css';

const Buttons = ({ to, text }) => {
  return (
    <Link to={to} className={classes.Button}>
      {text}
    </Link>
  );
};

export default Buttons;
